import { HiCurrencyDollar } from 'react-icons/hi';

// Dollars component 
export default function REturnDallArs() {
 return (
  <>
   <div className='wrp-dollars-dash'>
    <HiCurrencyDollar size={'1.5em'} />
    <p>2367 USD</p>
    <button className='btn-send'>Envoyer dollars</button>
   </div>
  </>
 );
};
